non_nullable_keys = {"ID", "id", "ReferenceType", "ReferenceValue"}


def prune_null_keys(dct: Dict[str, Any]):
    for key in non_nullable_keys:
        if key in dct and dct[key] is None:
            dct.pop(key)
    return dct


